import React, { Component } from 'react'

class Cities extends Component {
    render() {
        const { cities } = this.props;
        console.log(this.props.cities)


        return (
            <div>
                {cities.map(city => (
                    <div>
                        {city.name}
                    </div>
                ))}
            </div>
        )

    }



}


export default Cities;
